import React, { useState, useEffect } from 'react';
import Header from './components/Header';
import HeroBanner from './components/HeroBanner';
import Footer from './components/Footer';
import { API } from '../../Config'; // Use your config.js structure
import Services from './components/Services';
import MahareraInformation from './components/MahaReraInformation';
import Gallery from './components/Gallery';
import PropertyPriceTable from './components/PropertyPriceTable';
import PropertyDetails from './components/PropertyDetails';
import UnitLayout from './components/UnitLayout';
import FloorPlans from './components/FloorPlans';
import MasterPlan from './components/MasterPlan';
import Amenities from './components/Amenities';
import LocationMap from './components/LocationMap';
import LocationHighlights from './components/LocationHighlights';
import Video from './components/Video';
import FAQ from './components/FAQ';
import EMICalculator from './components/EMICalculator';
import BankPartners from './components/BankPartners';
import { Helmet } from 'react-helmet';
import ContactUs from './components/ContactUs';
import FloatingButtons from './components/FloatingButtons';
import axios from 'axios';

function App() {
  const [headerData, setHeaderData] = useState({});
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchHeaderData = async () => {
      try {
        const response = await axios.get(API.HEADER());
        setHeaderData(response.data);
      } catch (err) {
        setError('Failed to fetch header data');
      }
    };
    fetchHeaderData();
  }, []);

  if (error) return <div>{error}</div>;

  // Prepare title and meta description only if data is available
  const title = headerData.property_name && headerData.location 
    ? `${headerData.property_name} - ${headerData.location}`
    : 'Loading...';

  return (
    <div className="App">
      <Helmet>
        <title>{title}</title>
        <meta name="description" content={
          headerData.property_name && headerData.location
            ? `${headerData.property_name} - ${headerData.property_type_price_range_text} in ${headerData.location}, ${headerData.sublocation}, by ${headerData.builder_name}`
            : 'Loading description...'
        } />
        <meta name="keywords" content={
          headerData.property_name && headerData.location
            ? `real estate, ${headerData.property_name}, ${headerData.location}, ${headerData.sublocation}, property for sale`
            : 'Loading keywords...'
        } />
        <meta property="og:title" content={title} />
        <meta property="og:description" content={
          headerData.property_type_price_range_text && headerData.location
            ? `${headerData.property_type_price_range_text}, located at ${headerData.location}, ${headerData.sublocation}.`
            : 'Loading og description...'
        } />
        <meta property="og:image" content={headerData.hero_banner_img || ''} />
        <meta property="og:type" content="website" />
      </Helmet>
      <Header />
      <HeroBanner />
      <Services />
      <MahareraInformation />
      <PropertyPriceTable />
      <PropertyDetails />
      <Gallery />
      <Video />
      <UnitLayout />
      <MasterPlan />
      <FloorPlans />
      <Amenities />
      <LocationMap />
      <LocationHighlights />
      <BankPartners />
      <ContactUs />
      <EMICalculator />
      <FAQ />
      <Footer />
      <FloatingButtons />
    </div>
  );
}

export default App;
